import React from "react";
import { useState } from "react";
class Header extends React.Component {
    constructor()
    {
        super();
        this.state = {name : "0"}
    }
    render() {
      return (
        <div>
            <div>{this.state.name}</div>
            <input name="range" type="range" class="form-range" id="customRange1" min={0} max={100} step={10} onChange={e => this.setState({name : e.target.value})} />
        </div>
      );
    }
  }
  
  export default Header;
